import React from "react";
import Button from "react-bootstrap/Button";

export default function NominationsList(props) {
  return (
    <>
      <p>Search Results</p>
      <ul>
        {props.nominations.map((movie) => (
          <li>
            {movie.Title}, {movie.Year} <Button />
          </li>
        ))}
      </ul>
    </>
  );
}
